import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout.tsx';
import Home from './pages/Home.tsx';
import Pacientes from './pages/Pacientes.tsx';
import Medicos from './pages/Medicos.tsx';
import Hospitales from './pages/Hospitales.tsx';
import Citas from './pages/Citas.tsx'; // Nueva importación

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="pacientes" element={<Pacientes />} />
          <Route path="medicos" element={<Medicos />} />
          <Route path="hospitales" element={<Hospitales />} />
          <Route path="citas" element={<Citas />} /> {/* Nueva ruta */}
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
